__NUXT_JSONP__("/svet/mesto/port-louis", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u){return {data:[{place:[{id:h,id_state:j,name:k,population:154676,area:46.7,altitude:13,slug:l,information_chatgpt:a,coordinates:[{latitude:-20.1653,longitude:57.4964}],biggest:"yes",type_place:b,id_image_cover:a,id_image_hero:a,affiliate:[{name:m,value:f}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:c,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2024-03-02T11:05:40.678938+00:00",name_original:a,setting_top:f}],imagePlace:[],placeState:[{tld:".mu",name:"Mauricius",area:2040,population:1268315,slug:n,id_continent:g,information_chatgpt:"\u003Cp\u003EMauricius je ostrovní stát nacházející se v Indickém oceánu, zhruba 900 km východně od Madagaskaru. Je to malý, ale půvabný ostrov s pestrou historií a kulturou, který láká mnoho turistů z celého světa.\u003C\u002Fp\u003E\n\u003Cp\u003ENa Mauriciu najdete nádherné bílé písečné pláže, azurové vody a tropickou vegetaci. Ostrov je obklopen korálovými útesy, což z něj dělá perfektní destinaci pro potápěče a šnorchlování. Kromě toho je zde mnoho aktivit, jako jsou vodní sporty, golf, jízda na koni a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EKultura Mauricia je velmi pestrá a ovlivněna mnoha etniky, které sem přišly v minulosti. Francouzi, Britové, Hindové a Číňané jsou jen některé z kultur, které jsou zde patrné. To ovlivnilo také kuchyni Mauricia, která je bohatá a rozmanitá, kombinující prvky různých kultur.\u003C\u002Fp\u003E\n\u003Cp\u003EMauricius je také známý svými přírodními krásami, jako jsou národní parky, botanické zahrady a vodopády. Oblasti, jako je Black River Gorges National Park, jsou domovem pro mnoho druhů rostlin a zvířat, včetně vzácných endemických druhů, které se nacházejí pouze na Mauriciu.\u003C\u002Fp\u003E\n\u003Cp\u003EMauricius je také známý pro své luxusní hotely a letoviska. Zde najdete některé z nejkrásnějších a nejluxusnějších ubytování na světě. Turisté si mohou užívat skvělou službu, nádherné pláže a bohaté kulturní zážitky, které nabízí tento krásný ostrov.\u003C\u002Fp\u003E\n\u003Cp\u003ENavštívit Mauricius je nezapomenutelný zážitek pro každého, kdo hledá krásu, kulturu a dobrodružství v tropickém ráji.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:25,date_update:d},{name:"Hlavní jídlo",value:300,date_update:d},{name:"Chleba",value:15,date_update:d},{name:"Mléko",value:32,date_update:d},{name:"Voda (500ml)",value:20,date_update:d},{name:"Espresso",value:60,date_update:d},{name:"Zmrzlina (jeden kopeček)",value:50,date_update:d},{name:"Pivo",value:100,date_update:d},{name:"Krabička cigaret",value:o,date_update:d},{name:"Big Mac",value:o,date_update:d},{name:"Coca Cola (500ml)",value:30,date_update:d}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:e},{name:"Policie",value:"999",date_update:e},{name:"Hasiči",value:"995",date_update:e},{name:"Zdravotnická záchranná služba",value:"114",date_update:e}],phone_prefix:"+230",coordinates:[{latitude:"-20.3484",longitude:"57.5522"}],people_religion:[{name:"Hinduismus",value:"48%"},{name:"Křesťanství",value:"32%"},{name:"Islám",value:p},{name:q,value:"3%"}],people_nationality:[{name:"Kreolové",value:"27%"},{name:"Hinduisté",value:"26%"},{name:"Muslimové",value:p},{name:"Křesťané",value:"6%"},{name:q,value:"24%"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným dokladem pro vstup na území Mauricia. Je nutné mít platný cestovní pas.",date_update:e},{name:"Cestovní pas",value:"Pro vstup na území Mauricia je nutné mít platný cestovní pas. Občanský průkaz není platným dokladem.",date_update:e},{name:"Vízum",value:"Občané Evropské unie nepotřebují pro pobyt na Mauriciu vízum, pokud zde pobývají do 90 dnů. Pro delší pobyt je nutné žádat o vízum. Vízum lze žádat na velvyslanectví Mauricia v zemi občana nebo přímo na hranicích. ",date_update:e},{name:"Očkování",value:"Pro vstup na území Mauricia není povinné očkování. Nicméně, doporučuje se očkování proti žluté zimnici pro osoby, které přijíždějí z oblastí, kde je tato nemoc běžná.",date_update:e},{name:"Cestovní pojištění",value:"Při vstupu na území Mauricia není nutné mít cestovní nebo zdravotní pojištění. Nicméně, doporučuje se mít platné cestovní pojištění, které pokryje případné náklady na lékařské ošetření nebo repatriaci.",date_update:e},{name:"Bezpečnostní situace",value:"Mauricius je obecně bezpečnou zemí s nízkou mírou kriminality. Nicméně, je vhodné dodržovat základní bezpečnostní opatření, jako například uchovávat cennosti v bezpečí a vyhýbat se nebezpečným oblastem.",date_update:e},{name:"Další informace",value:"Při vstupu na území Mauricia je nutné projít celní kontrolou, která zahrnuje prohlídku zavazadel a osobních věcí. Je zakázáno vstupovat na území Mauricia s jakýmikoli zakázanými látkami, jako jsou například drogy, pornografický materiál nebo nebezpečné zbraně. Dále platí, že je zakázáno lovit, poškozovat nebo odnášet chráněné druhy rostlin a zvířat. Pro pobyt na Mauriciu déle než 90 dnů je nutné zaregistrovat se na místním policejním úřadě a žádat o prodloužení pobytu.",date_update:e}],type_place:r,id_image_cover:i,id_image_hero:i,id_city_main:h,affiliate:[{name:m,value:f}],mpz:"MU",alerts:a,zoom:[{google:s,booking:s}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:j,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-02T11:05:26.667745+00:00",name_original:a,currency:[{code:"MUR",name:"mauricijská rupie"}],setting_top:f}],imageState:[{id:i,name:n,source:"\u002Fworld\u002Fstates\u002F",type:r,author:"pixabay.com",created_at:"2023-05-03T20:14:00.749527+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:g,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:g,id_image_hero:g,zoom:[{google:2,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:t,date_update:t,author_create:u,author_update:u}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-02T11:45:40.694514+00:00",name_original:"Africa",setting_top:f}],placesCities:[{id:1510,id_image_cover:a,importance:c,slug:"beau-bassin-rose-hill",type_place:b,name:"Beau Bassin-Rose Hill"},{id:1515,id_image_cover:a,importance:c,slug:"centre-de-flacq",type_place:b,name:"Centre de Flacq"},{id:1511,id_image_cover:a,importance:c,slug:"curepipe",type_place:b,name:"Curepipe"},{id:1514,id_image_cover:a,importance:c,slug:"goodlands",type_place:b,name:"Goodlands"},{id:1517,id_image_cover:a,importance:c,slug:"grand-baie",type_place:b,name:"Grand Baie"},{id:1516,id_image_cover:a,importance:c,slug:"mahebourg",type_place:b,name:"Mahébourg"},{id:h,id_image_cover:a,importance:c,slug:l,type_place:b,name:k},{id:1512,id_image_cover:a,importance:c,slug:"quatre-bornes",type_place:b,name:"Quatre Bornes"},{id:1513,id_image_cover:a,importance:c,slug:"triolet",type_place:b,name:"Triolet"},{id:1509,id_image_cover:a,importance:c,slug:"vacoas-phoenix",type_place:b,name:"Vacoas-Phoenix"}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarEventComponent:0":{events:[],images:a}},mutations:[]}}(null,"city","biggest","05-2021","05-2023",true,5,1508,315,154,"Port Louis","port-louis","booking","mauricius","nemožné zjistit","17%","Jiné","state",9,"2024-03-01","1")));